import React from 'react';
import author1 from './resource/author1.jpeg';
import author2 from './resource/author2.jpeg';
import author3 from './resource/author3.jpeg';
import author4 from './resource/author4.jpeg';
import author5 from './resource/author5.jpeg';
import author6 from './resource/author6.jpeg';
import { Image } from 'react-bootstrap';
import Figure from 'react-bootstrap/Figure';


export default function ImageHolder(props) {
    function returnImage() {
        let image = '';
        switch (props.id) {
            case 1:
                image = <Figure>
                    <Figure.Image
                        width={400}
                        height={400}
                        alt="171x180"
                        src={author1}
                        rounded
                    />
                    <Figure.Caption>
                        {props.name} in August 1987
                    </Figure.Caption>
                </Figure>;
                // image = <Image src={author1} rounded />
                break;
            case 2:
                image = <Figure>
                <Figure.Image
                    width={400}
                    height={400}
                    alt="171x180"
                    src={author1}
                    rounded
                />
                <Figure.Caption>
                    {props.name} in August 1987
                </Figure.Caption>
            </Figure>;
                break;
            case 3:
                image = <Figure>
                <Figure.Image
                    width={400}
                    height={400}
                    alt="171x180"
                    src={author1}
                    rounded
                />
                <Figure.Caption>
                    {props.name} in December 1989
                </Figure.Caption>
            </Figure>;
                break;
            case 4:
                image = <Figure>
                <Figure.Image
                    width={400}
                    height={400}
                    alt="171x180"
                    src={author1}
                    rounded
                />
                <Figure.Caption>
                    {props.name} in August 1993
                </Figure.Caption>
            </Figure>;
                break;
            case 5:
                image = <Figure>
                <Figure.Image
                    width={400}
                    height={400}
                    alt="171x180"
                    src={author1}
                    rounded
                />
                <Figure.Caption>
                    {props.name} in July 1995
                </Figure.Caption>
            </Figure>;
                break;
            case 6:
                image = <Figure>
                <Figure.Image
                    width={400}
                    height={400}
                    alt="171x180"
                    src={author1}
                    rounded
                />
                <Figure.Caption>
                    {props.name} in August 1964
                </Figure.Caption>
            </Figure>;
                break;
            default:
                image = <Figure>
                <Figure.Image
                    width={400}
                    height={400}
                    alt="Invisible man"
                    rounded
                />
                <Figure.Caption>
                    {props.name} in March 1961
                </Figure.Caption>
            </Figure>;

        }
        return image;
    }
    return (
        <div>
            {
                returnImage()
            }
        </div>
    );
}
